import React from 'react';
import PodPayLayout from './PodPayLayout';
import PodcastDetails from './PodcastDetails';

export default function PodcastPage({ userInfo }) {
  return (
    <PodPayLayout
      activeMenuItem="podcast"
      headerTitle="Podcast"
      headerSubtitle="Podcast Details"
      userInfo={userInfo}
    >
      <div className="p-8">
        <PodcastDetails />
      </div>
    </PodPayLayout>
  );
}
